import React from 'react';


export default function ExtendedTableRow(props){  
    return (   
        <div style={styles.extendedcontent}>
            <h1>TESTE</h1>
        
        
        </div>
 

    )
}


const style = {
    parentDiv: {
        backgroundColor: "rgb(163, 163, 163,0.8)",
        position: "fixed",
        zIndex: 10,
        width: "100%",
        height: "100%",
        display: "flex",
        justifyContent: "center",
        alignItems: "center"
    },

    modalDiv: {
        backgroundColor: "#fffafa",
        width: "50%",
        height: "50%",
        position: "relative"
    },

    modalButton: {
        fontSize: "15px",
        backgroundColor: "#ffc9c9",
        width: "30px",
        height: "30px",
        borderRadius: "50%",
        borderColor: "#ffff",
        position: "absolute",
        top: "-4px",
        right: "-4px",
        color: "#525252"
    },

    headerModal: {
        backgroundColor: "#ff8f8f",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        width: "100%",
        height: "20%",
    },
    headerModalContent: {
        height: "20%",
        backgroundColor: "#ffffff"
    },

    headerModalLine: {
        backgroundColor: "pink",
        width: "100%",
        height: "4px",
        marginTop: "0px"
    },

    headerButton: {
        fontSize: "20px",
        display: "inline",
        height: "50px",
        width: "40%",
        margin: "0 5%",
        backgroundColor: "#ff7d7d",
        color: "#ffffff",
        border: "none",
        cursor: "pointer"
    },

    headerDefault: {
        fontSize: "20px",
        display: "inline",
        height: "50px",
        width: "80%",
        margin: "0 10%",
        backgroundColor: "#ff7d7d",
        color: "#ffffff",
        border: "none",
        cursor: "pointer"
    }
};
